Pop Charts Britannia: 60 Years of the Top 10

Arts Documentary hosted by Ben Whalley, published by BBC in 2012 - English narration


Information
------------------------------

Documentary chronicling our ever-changing love affair with the British singles chart on the occasion of its 60th anniversary. From the first NME chart in 1952, via Pick and Top of the Pops to home-taping the Radio One chart show and beyond, we have measured out our lives to a wonderful churn of pop driven, unbeknownst to us, by a clandestine world of music biz hustle.

Featuring contributions by 60 years of BBC chart custodians from David Jacobs to Reggie Yates, chart fans Grace Dent and Pete Paphides and music biz veterans Jon Webster and Rob Dickins.

